!                                                 
!     interpolation routine                       
!                                                 
      lo_loside = 0
      lo_hiside = 0
      hi_loside = 0
      hi_hiside = 0
      if (xlo .le. x_data(1)) then
         lo_loside = 1
         lo_hiside = 1
      end if
      if (xhi .le. x_data(1)) then
         hi_loside = 1
         hi_hiside = 1
      end if
      if (xlo .ge. x_data(N)) then
         lo_loside = N
         lo_hiside = N
      end if
      if (xhi .ge. x_data(N)) then
         hi_loside = N
         hi_hiside = N
      end if
      if (lo_loside.eq.0) then
         do i = 1, N-1                           
            if ( (xlo .ge. x_data(i)) .and. (xlo .le. x_data(i+1)) ) then
               lo_loside  = i
               lo_hiside  = i+1
            end if
         end do
      end if
      if (hi_loside.eq.0) then            
         do i = 1, N-1                           
            if ( (xhi .ge. x_data(i)) .and. (xhi .le. x_data(i+1)) ) then
               hi_loside = i
               hi_hiside = i + 1
            end if
         end do
      end if

      usual_interp = .FALSE.
         
      IF ( usual_interp ) THEN
         do j = 1, M
            
            x1 = x_data(lo_loside)
            y1 = y_data(lo_loside,j)
            
            x2 = x_data(lo_hiside)
            y2 = y_data(lo_hiside,j)
             
            if (lo_loside.eq.lo_hiside) then
               dydx = 0.d0
            else
               dydx = (y2-y1)/(x2-x1)
            end if
            
            ylo = y1 + dydx*(xlo - x1)
            
            if (lo_loside .eq. hi_loside) then
               
               yhi = y1 + dydx*(xhi - x1)
               
               y_vector(j) = 0.5d0*(ylo + yhi)
               
            else
               
               sum = (x2 - xlo) * 0.5d0 * (ylo + y2)
               
               x1 = x_data(hi_loside)
               y1 = y_data(hi_loside,j)
            
               x2 = x_data(hi_hiside)
               y2 = y_data(hi_hiside,j)
               
               if (hi_loside.eq.hi_hiside) then
                  dydx = 0.d0
               else
                  dydx = (y2-y1)/(x2-x1)
               end if
               
               yhi = y1 + dydx*(xhi - x1)
               
               sum = sum + (xhi - x1)*0.5d0*(yhi+y1)
               
               do k = lo_hiside,hi_loside-1
                  
                  sum = sum + (x_data(k+1)-x_data(k)) &
                       * 0.5d0 * (y_data(k,j) + y_data(k+1,j))
                  
               end do
               
               y_vector(j) = sum / (xhi - xlo)
               
            end if
         end do
      ELSE
         IF ( ABS(xlo-xhi) > 1.0d-6  ) THEN
            WRITE(*,*) "Interpolating in PMF using Hermite Cubic Splines"
            WRITE(*,*) "xlo and xhi should be the same here"
            STOP
         END IF

         do j = 1, M

            !          k-1           k         k+1
            !   --X-----------X-----------X----------X--
            !             lo_loside   lo_hiside
            !
            ! Get data lo and hi
            x1 = x_data(lo_loside)
            y1 = y_data(lo_loside,j)
            x2 = x_data(lo_hiside)
            y2 = y_data(lo_hiside,j)

            ! Compute Delta in k-1, k, k+1
            IF ( lo_loside /= 1 ) THEN
               Dkm1 = (y_data(lo_loside,j) - y_data(lo_loside-1,j)) / ( x_data(lo_loside) - x_data(lo_loside-1) )
            END IF
            Dk = (y_data(lo_hiside,j) - y_data(lo_loside,j)) / ( x_data(lo_hiside) - x_data(lo_loside) )
            IF ( lo_hiside /= N ) THEN
               Dkp1 = (y_data(lo_hiside+1,j) - y_data(lo_hiside,j)) / ( x_data(lo_hiside+1) - x_data(lo_hiside) )
            END IF

            ! Compute Delta at loside and hiside
            IF ( Dkm1*Dk < 0.0d0 ) THEN
               Dklo = 0.0d0
            ELSE
               Dklo = 0.5d0*(Dkm1+Dk)
            END IF
            IF ( Dkp1*Dk < 0.0d0 ) THEN
               Dkhi = 0.0d0
            ELSE
               Dkhi = 0.5*(Dk+Dkp1)
            END IF
            IF ( ABS(Dk) < 1.0d-12 ) THEN
               Dklo = 0.0d0
               Dkhi = 0.0d0
               !Compute interpolant
               x_sc = (xlo - x1)/(x2-x1)
               f1 = 2.0d0*x_sc**3.0d0 -3.0d0*x_sc**2.0d0+1.0d0
               f2= x_sc**3.0d0 - 2.0d0*x_sc**2.0d0+x_sc
               f3=-2.0d0*x_sc**3.0d0+3.0d0*x_sc**2.0d0
               f4=x_sc**3.0d0-x_sc**2.0d0
               y_vector(j) = f1*y1+f2*(x2-x1)*Dklo+f3*y2+f4*(x2-x1)*Dkhi
            ELSE
               ak = Dklo / Dk
               bk = Dkhi / Dk
               IF ( (ak*ak + bk*bk) > 9 )  THEN
                  tauk = 3.0d0 / SQRT(ak*ak+bk*bk)
                  Dklo = tauk*ak*Dk
                  Dkhi = tauk*bk*Dk
               END IF
               !Compute interpolant
               x_sc = (xlo - x1)/(x2-x1)
               f1 = 2.0d0*x_sc**3.0d0 -3.0d0*x_sc**2.0d0+1.0d0
               f2= x_sc**3.0d0 - 2.0d0*x_sc**2.0d0+x_sc
               f3=-2.0d0*x_sc**3.0d0+3.0d0*x_sc**2.0d0
               f4=x_sc**3.0d0-x_sc**2.0d0
               y_vector(j) = f1*y1+f2*(x2-x1)*Dklo+f3*y2+f4*(x2-x1)*Dkhi
            END IF
         END DO

      END IF
